import './MainPage.css';

function MainPage() {
  return (
    <div className ="MainPageBody">
        <div className="Layout"> 
            <div class="Welcome">1</div>

            <div class="Search-Bar">

            <div style="display: flex; justify-content:center ; align-items: center;height: 100vh;overflow: hidden;">
                <form  class="bar">
                    <input type="search" name="search" pattern=".*\S.*" required autocomplete="off"/>
                    <button class="search-btn" type="submit">
                    <span>Search</span>
                    </button>
                </form>
                </div>

            </div>

            <div class="Sort-And-Filter">3</div>
            <div class="Universities-Container">4</div>
        </div>
    </div>
  );    
}

export default MainPage;
